import Header from './components/Header';
import './input.css'

function App() {
  return (
    <div className="App">
      <Header />
      <header className="App-header">
        <h1 class="text-6xl font-bold underline">
          Hello world!
        </h1>
      </header>
    </div>
  );
}

export default App;
